  false,\n\t\"url\": null,\n\t\"notes\": \"Organochlorine analysis did not reveal
  any 0CH traces in the sediments. Low traces of some 0CHs including DDE were found
  in both bird liver samples (Appendix 2). DDE shows the persistence of this substance
  in the environment and can be traced back to the extensive use of DDT for mosquito
  control. Other OCHs found are the result of exposure to agricultural chemicals.
  The fact that no OCHs were found in the sediment should not be misinterpreted; sediment
  samples were limited to the periphery of the lagoon. Contaminated sediments could
  have settled in the deeper, inaccessible center of the lagoon. Heavy metal analysis
  shows some bioaccumulation of mercury in waterfowl but concentrations are well below
  those known to cause any lethal or sublethal effects.\",\n\t\"license_title\": \"License
